import PropTypes from "prop-types";

const Header = ({ title }) => {
  return (
    <div>
      <header>
        <h1>{title}</h1>
        <button>Add</button>
      </header>
    </div>
  );
};

Header.defaultProps = { title: "Task Tracker" };

Header.propTypes = {
  title: PropTypes.string,
};

export default Header;
